import React, { useState } from 'react'

const Login = () => {
    const [userForm, setUserForm] = useState({username: "", password: ""})

    const handleChange = e => {
        setUserForm({...userForm, [e.target.name]: e.target.value})
    }

    return (
        <div>
            <form>
                <input onChange={e => handleChange(e)} value={userForm.username} name="username" required/>
                <input onChange={e => handleChange(e)} value={userForm.password} name="password" type="password" required/>
            </form>
        </div>
    )
}

export default Login
